import React, { useState } from 'react';
import { Container, Row, Col, Card, Form, Button, Alert } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const Login: React.FC = () => {
  const navigate = useNavigate();
  const { login } = useAuth();
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  
  const [formData, setFormData] = useState({
    username: '',
    password: ''
  });

  const [errors, setErrors] = useState<{ username?: string; password?: string }>({});

  const validateForm = (): boolean => {
    const newErrors: { username?: string; password?: string } = {};

    if (!formData.username.trim()) {
      newErrors.username = 'Username is required';
    }

    if (!formData.password) {
      newErrors.password = 'Password is required';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError('');

    if (!validateForm()) return;

    try {
      setLoading(true);
      await login(formData.username, formData.password);
      navigate('/dashboard');
    } catch (error: any) {
      setError(error.response?.data?.message || 'Login failed. Please check your credentials.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container className="login-container">
      <Row className="justify-content-center">
        <Col md={6} lg={4}>
          <Card className="ph-login-card shadow">
            {/* Philippine Flag Strip */}
            <div className="ph-flag-strip"></div>
            
            <Card.Body className="p-4 p-md-5">
              {/* Logo Area */}
              <div className="text-center mb-4">
                <h4 className="company-title mb-1">Philippine Procurement Solutions</h4>
                <p className="text-muted mb-4">
                  <i className="bi bi-shield-check me-2"></i>
                  Philippine-Compliant Procurement Management
                </p>
              </div>

              <h5 className="card-title text-center mb-4">Login to Your Account</h5>

              {error && (
                <Alert variant="danger" dismissible onClose={() => setError('')}>
                  {error}
                </Alert>
              )}

              <Form onSubmit={handleSubmit} className="ph-form">
                <Form.Group className="mb-3">
                  <Form.Label htmlFor="username">
                    <i className="bi bi-person me-2"></i>Username
                  </Form.Label>
                  <Form.Control
                    id="username"
                    type="text"
                    placeholder="Enter your username"
                    value={formData.username}
                    onChange={(e) => setFormData({ ...formData, username: e.target.value })}
                    isInvalid={!!errors.username}
                    aria-describedby="usernameError"
                    disabled={loading}
                  />
                  <Form.Control.Feedback type="invalid" id="usernameError">
                    {errors.username}
                  </Form.Control.Feedback>
                </Form.Group>

                <Form.Group className="mb-4">
                  <Form.Label htmlFor="password">
                    <i className="bi bi-lock me-2"></i>Password
                  </Form.Label>
                  <Form.Control
                    id="password"
                    type="password"
                    placeholder="Enter your password"
                    value={formData.password}
                    onChange={(e) => setFormData({ ...formData, password: e.target.value })}
                    isInvalid={!!errors.password}
                    aria-describedby="passwordError"
                    disabled={loading}
                  />
                  <Form.Control.Feedback type="invalid" id="passwordError">
                    {errors.password}
                  </Form.Control.Feedback>
                </Form.Group>

                <div className="d-grid">
                  <Button 
                    type="submit" 
                    className="ph-btn-primary" 
                    disabled={loading}
                    aria-label="Sign in to account"
                  >
                    {loading ? (
                      <>
                        <span className="spinner-border spinner-border-sm me-2" role="status" aria-hidden="true"></span>
                        Signing in...
                      </>
                    ) : (
                      <>
                        <i className="bi bi-box-arrow-in-right me-2"></i>
                        Sign in
                      </>
                    )}
                  </Button>
                </div>
              </Form>
            </Card.Body>
          </Card>

          {/* Footer Info */}
          <div className="text-center mt-4 small text-muted">
            <div className="mb-2">
              <i className="bi bi-building me-2"></i>
              123 Ayala Avenue, Makati City, Philippines
            </div>
            <div>
              <i className="bi bi-card-text me-2"></i>
              BIR TIN: 123-456-789-000
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Login;
